import classes from './BillItem.module.css';

const BillItem=(props) =>{
    // const cart=useSelector((state)=>state.bill.items);
    // const dispatch=useDispatch();
    
    // const addToCartHandler = amount => {
    //   dispatch(billActions.addItemToCart({
    //     id: props.id,
    //     name: props.name,
    //     amount: amount,
    //     price: props.price
    //   }));
    // };
  
    return (
      <li className={classes.bill}>
        <div className={classes.bill}>
            <div className={classes.info}>
            <p>Bill number:</p>
            {props.id}
            </div>
            <div className={classes.info}>
            <p>Total cost</p>
            {props.totalCost}
            </div>
            <div className={classes.info}>
            <p>Credit card:</p>
            {props.creditCard}
            </div>
          <div className={classes.price}></div>
        </div>
        <div>
            <button className={classes.delete}>delete bill</button>
        </div>
      </li>
    );
  };

  export default BillItem;
